class ContentCardExample extends HTMLElement {

    constructor() {
        super();

        this._hass = {};

        this.$wrapper = null;
        this.$container = null;

        this.$car = null;
    }


    set hass(hass) {

        console.log("hass")

        this._hass = hass;
        if (!this.$wrapper) {
            this._render();
        }
        this._update();

    }

    _render() {
        this.$pandoraId = this.config.pandora_id;
        const device_tracker = "device_tracker." + this.$pandoraId;

        const card = document.createElement('ha-card');
        const style = document.createElement('style');
        card.header = this._getAttr(device_tracker, 'friendly_name') || '';
        style.textContent = `@-webkit-keyframes engine { 0% { -webkit-transform: rotate(720deg); }
  100% { -webkit-transform: rotate(0deg); } }

@-moz-keyframes engine { 0% { -moz-transform: rotate(360deg); }
  100% { -moz-transform: rotate(0deg); } }

@keyframes engine { 0% { transform: rotate(360deg); }
  100% { transform: rotate(0deg); } }

.car { margin: auto; width: 310px; height: 200px; position: relative; background: url(data:image/png;base64,) no-repeat 18px 40px; }

.car > div { position: absolute; }

.car > div:after { position: relative; font-size: 12px; top: 3px; }

.car .left-front-door, .car .right-front-door, .car .left-back-door, .car .right-back-door { position: absolute; width: 72px; height: 25px; }

.car .left-front-door { background: url(data:image/png;base64,) no-repeat center; top: 135px; right: 141px; }

.car .right-front-door { background: url(data:image/png;base64,) no-repeat center; top: 41px; right: 137px; }

.car .left-back-door { background: url(data:image/png;base64,) no-repeat center; top: 131px; right: 80px; }

.car .right-back-door { background: url(data:image/png;base64,) no-repeat center; top: 45px; right: 75px; }

.car .icon-center { background: url(data:image/png;base64,) no-repeat -37px 0; top: 73px; height: 45px; right: 92px; width: 67px; }

.__guard .car .icon-center { background: url(data:image/png;base64,) no-repeat 0 0; right: 105px; width: 40px; }

.__active_guard .car .icon-center { background: url(data:image/png;base64,) no-repeat -105px 0; top: 69px; right: 100px; width: 50px; height: 50px; }

.__service .car .icon-center { background: url(data:image/png;base64,) no-repeat -155px 0; right: 108px; width: 40px; }

.car .engine { background: url(data:image/png;base64,) no-repeat -201px -1px; top: 80px; right: 230px; width: 36px; height: 36px; -webkit-animation: engine 1.8s infinite linear; -moz-animation: engine 1.8s infinite linear; animation-play-state: paused; -webkit-animation-play-state: paused; }

.__engine .car .engine { animation-play-state: running; -webkit-animation-play-state: running; }
`;
        card.innerHTML = `<div class="wrapper">
    <div class="container">
        <div class="car">
            <div class="left-front-door"></div>
            <div class="left-back-door"></div>
            <div class="right-front-door"></div>
            <div class="right-back-door"></div>
            <div class="icon-center"></div>
            <div class="engine"></div>
        </div>
    </div>
</div>`;
        card.appendChild(style);
        this.appendChild(card);

        this.$wrapper = card.querySelector('.wrapper');
        this.$container = this.$wrapper.querySelector('.container');

        this.$car = this.$container.querySelector('.car');
    }

    _update() {
        const engine = 'binary_sensor.' + this.$pandoraId + '_engine_state';
        const lock = 'binary_sensor.' + this.$pandoraId + '_lock';
        this.$container.classList.toggle('__engine', this._getState(engine));
        this.$container.classList.toggle('__guard', !this._getState(lock));
    }

    _getState(entity_id) {
        console.log(entity_id)
        let entity = this._hass.states[entity_id],
            state = entity ? entity.state : 'unavailable';
        if (state === 'on' || state === 'off' || state === 'unlocked' || state === 'locked') {
            console.log(state)
            return state === 'on' || state === 'locked';
        }
        if (state !== 'unavailable') {
            console.log(state)
            return state;
        }
        console.log(state)
        return null;
    }

    _getAttr(entity_id, name) {
        let entity = this._hass.states[entity_id];
        if (!entity || !entity.attributes.hasOwnProperty(name)) {
            return null;
        }
        return entity.attributes[name];
    }

    setConfig(config) {
        if (!config.pandora_id) {
            throw new Error('You need to define a pandora_id');
        }
        this.config = config;
    }

    // The height of your card. Home Assistant uses this to automatically
    // distribute all cards over the available columns.
    getCardSize() {
        return 10;
    }
}

customElements.define('pandora-cas-card', ContentCardExample);
